    const {state} = useLocation()
    const patientId = state.patientId
    const navigate = useNavigate()

    const [doctors, setDoctors] = useState([])

    const fetchDoctors = async () => {
        const res = await fetch(`http://localhost:8080/doctors`)
        const data = await res.json()

        return data
    }

    useEffect(() => {
        const getDoctors = async () => {
            const doctorsFromLocal = await fetchDoctors()
            console.log(doctorsFromLocal)
            setDoctors(doctorsFromLocal)
        }

        getDoctors()
    }, [])

    const onLogOutSubmit = (e) => {
        e.preventDefault()

        navigate('/', {
        })
    }

    return (
        <div>
            <div className = "row">
                <div style={{color: '#0b4a2b', marginLeft : 50, fontSize : 50}}>DocConnect</div>
                <button className = "btn" style = {{marginLeft : 1000}} type="submit" id='btn-log-out' onClick={(e) => onLogOutSubmit(e)}>
                    Log out
                </button>
            </div>
            <div>
                <div className = "container-2">

                </div>
            </div>
        </div>
    )
};

export default SelectDoctorPage;
